import React, { useState } from "react";
import { Grid, Paper, Button, Drawer, List, ListItem, Typography, IconButton, Card } from "@material-ui/core";

import QuestionData from "../utilities/questions.json";

import '@fontsource/roboto';

const ContactForm = () => {

    const style = {
        card: {
            display: 'flex',  
            justifyContent:'center', 
            alignItems:'center',
            height: "70%",
            width: "80%",
            margin: 50,
            textAlign: "center"
        },
        title: {
            marginTop: 20,
            marginBottom: 20
        },
        question: {
            marginTop: 20,
            marginBottom: 20
        },
        input: {
            marginTop: 20,
            marginBottom: 20
        },
        button: {
            marginTop: 20,
            marginBottom: 20
        }
    }

    const [questionNum, setQuestionNum] = useState(0)

    const nextQuestion = (e) => {
        e.preventDefault();
        setQuestionNum(questionNum + 1)
    }

    const prevQuestion = (e) => {
        e.preventDefault();
        setQuestionNum(questionNum - 1)
    }

    const [answer, setAnswer] = useState({
        0: ""
    })

    const handleAnswer0 = (e) => {
        setAnswer({ ...answer, 0: e.target.value })
    }

    const handleAnswer1 = (e) => {
        setAnswer({ ...answer, 1: e.target.value })
    }

    const handleAnswer2 = (e) => {
        setAnswer({ ...answer, 2: e.target.value })
    }

    const handleAnswer3 = (e) => {
        setAnswer({ ...answer, 3: e.target.value })
    }
    const handleAnswer4 = (e, selection) => {
        e.preventDefault();
        setAnswer({ ...answer, 4: selection})
    }

    const handleAnswer = () => {
        switch(questionNum) {
            case 1:
                return (<><input defaultValue="" onChange={handleAnswer1} /></>)
            case 2: 
                return (<></>)
            case 3:
                return (<></>)
            case 4:
                return (<></>)
            default:
                return (
                    <>
                       <p>Name</p> <input defaultValue="" onChange={handleAnswer0}/>
                       <p>Phone</p> <input defaultValue="" onChange={handleAnswer1} />
                       <p>Email</p> <input defaultValue="" onChange={handleAnswer2} />
                       <p>City/State</p> <input defaultValue="" onChange={handleAnswer3} />
                       <p>Preferred Method of Contact</p> <button onClick={(e, value) => handleAnswer4(e, "Email")}>Email</button><button onClick={(e, value) => handleAnswer4(e, "Phone")}>Phone</button>
                    </>)

        }
    }

    return (
        <>
            <Card style={style.card}>
                <Grid container direction="row" alignItems="center" justifyContent="center">
                    <Grid item md="12" xs="12">
                        <Typography style={style.title}>Please answer the following questions</Typography>
                    </Grid>
                    <Grid item md="1" xs="1">
                        {(questionNum === 0) 
                        ? <p> - </p> 
                        : <button onClick={prevQuestion}> - </button>}
                    </Grid>
                    <Grid item md="10" xs="10">
                        <Typography style={style.question}>{QuestionData.data[questionNum].question}</Typography>
                            {handleAnswer()}
                    </Grid>
                    <Grid item md="1" xs="1">
                        {(questionNum === QuestionData.data.length - 1) 
                        ? <p> + </p> 
                        : <button onClick={nextQuestion}> + </button>}
                    </Grid>
                    <Grid item md="12" xs="12">
                        {(questionNum === QuestionData.data.length - 1) 
                        ? <Button style={style.button}>Submit</Button> 
                        : <Button onClick={nextQuestion} style={style.button}>Next</Button>}
                    </Grid>        
                </Grid>
            </Card>
        </>
    )
}

export default ContactForm;
